import {React} from 'react'

//pager
export default (props)=>
{
    //undefined array
    var numbers=[]

    for(let i=1;i<=10;i++)
    {
       numbers.push(i) 
    }
    return(<>
         <div class="conatiner p-5">

            <ul class="pagination">
            {
                numbers.map((res,i)=>`<li class="page-item">
                <a class="page-link" >${res}</a></li>`)
            }
            </ul>
         </div>
    </>)
}
